/*Data for the table `zly_article` */

insert  into `zly_article`(`ar_id`,`ar_title`,`ar_text`,`ar_text_json`,`ar_type`,`ar_path`,`ar_ispath`,`ar_firstpath`,`ar_user`,`ar_org`,`create_time`,`update_time`,`ar_major_type`,`pdf_type`) values ('1111','创建国家卫生区知识','<p>请创卫工作人人参与  美好环境家家受益</p><p><br>什么是国家卫生区？<br>国家卫生区是由全国爱国卫生运动委员会办公室评审并命名的国家级卫生优秀行政区，体现了美好的生活环境和良好的市民素质等内涵，是反映区域经济社会发展水平、文明健康程度的一项重要指标，是全国重要的形象品牌之一。<br><br>为什么要创建国家卫生区？<br>创建国家卫生区，是贯彻落实党的十九大和习近平总书记系列重要讲话精神、立足首都“四个中心”定位服务首都发展大局、不断推进新时期爱国卫生工作的重要举措，对提升地区环境面貌、改善人民居住环境、提高群众生活质量和健康水平具有十分重要的意义。<br>朝阳区作为首都的发展大区、承载大区、窗口大区，开展国家卫生区创建活动是建设“健康朝阳”的重要基础和必备条件，也是提升城市品质和群众获得感的重要载体，是朝阳建设和谐宜居模范区的重要抓手。<br><br>创建国家卫生区有哪些意义？<br>创建国家卫生区，能使基础设施建设得到快速发展，环境卫生质量得到显著改善，生态与居住环境得到不断优化，城市管理与服务能力得到整体提升，居民健康卫生水平得到明显提高，彻底改变城市脏、乱、差的面貌，使朝阳成为天蓝、水碧、地绿，干净、整洁、有序，人与自然和谐统一，社会与经济协调发展，具有可持续发展潜力与实力的健康城区，让老百姓生活得更加安逸、舒心。<br><br>创建国家卫生区包括哪些内容？<br>1、爱国卫生组织管理<br>2、健康教育和健康促进<br>3、市容环境卫生<br>4、环境保护<br>5、重点场所卫生<br>6、食品和生活饮用水安全<br>7、公共卫生与医疗服务<br>8、病媒生物预防控制</p><p><br></p>','[{\"tag\":\"p\",\"attrs\":[],\"children\":[\"请创卫工作人人参与  美好环境家家受益\"]},{\"tag\":\"p\",\"attrs\":[],\"children\":[{\"tag\":\"br\",\"attrs\":[],\"children\":[]},\"什么是国家卫生区？\",{\"tag\":\"br\",\"attrs\":[],\"children\":[]},\"国家卫生区是由全国爱国卫生运动委员会办公室评审并命名的国家级卫生优秀行政区，体现了美好的生活环境和良好的市民素质等内涵，是反映区域经济社会发展水平、文明健康程度的一项重要指标，是全国重要的形象品牌之一。\",{\"tag\":\"br\",\"attrs\":[],\"children\":[]},{\"tag\":\"br\",\"attrs\":[],\"children\":[]},\"为什么要创建国家卫生区？\",{\"tag\":\"br\",\"attrs\":[],\"children\":[]},\"创建国家卫生区，是贯彻落实党的十九大和习近平总书记系列重要讲话精神、立足首都“四个中心”定位服务首都发展大局、不断推进新时期爱国卫生工作的重要举措，对提升地区环境面貌、改善人民居住环境、提高群众生活质量和健康水平具有十分重要的意义。\",{\"tag\":\"br\",\"attrs\":[],\"children\":[]},\"朝阳区作为首都的发展大区、承载大区、窗口大区，开展国家卫生区创建活动是建设“健康朝阳”的重要基础和必备条件，也是提升城市品质和群众获得感的重要载体，是朝阳建设和谐宜居模范区的重要抓手。\",{\"tag\":\"br\",\"attrs\":[],\"children\":[]},{\"tag\":\"br\",\"attrs\":[],\"children\":[]},\"创建国家卫生区有哪些意义？\",{\"tag\":\"br\",\"attrs\":[],\"children\":[]},\"创建国家卫生区，能使基础设施建设得到快速发展，环境卫生质量得到显著改善，生态与居住环境得到不断优化，城市管理与服务能力得到整体提升，居民健康卫生水平得到明显提高，彻底改变城市脏、乱、差的面貌，使朝阳成为天蓝、水碧、地绿，干净、整洁、有序，人与自然和谐统一，社会与经济协调发展，具有可持续发展潜力与实力的健康城区，让老百姓生活得更加安逸、舒心。\",{\"tag\":\"br\",\"attrs\":[],\"children\":[]},{\"tag\":\"br\",\"attrs\":[],\"children\":[]},\"创建国家卫生区包括哪些内容？\",{\"tag\":\"br\",\"attrs\":[],\"children\":[]},\"1、爱国卫生组织管理\",{\"tag\":\"br\",\"attrs\":[],\"children\":[]},\"2、健康教育和健康促进\",{\"tag\":\"br\",\"attrs\":[],\"children\":[]},\"3、市容环境卫生\",{\"tag\":\"br\",\"attrs\":[],\"children\":[]},\"4、环境保护\",{\"tag\":\"br\",\"attrs\":[],\"children\":[]},\"5、重点场所卫生\",{\"tag\":\"br\",\"attrs\":[],\"children\":[]},\"6、食品和生活饮用水安全\",{\"tag\":\"br\",\"attrs\":[],\"children\":[]},\"7、公共卫生与医疗服务\",{\"tag\":\"br\",\"attrs\":[],\"children\":[]},\"8、病媒生物预防控制\"]},{\"tag\":\"p\",\"attrs\":[],\"children\":[{\"tag\":\"br\",\"attrs\":[],\"children\":[]}]}]','TZTG','/images/1.jpg','01','','1','紫萝园社区','2020-01-04 15:48:25','2020-01-14 13:51:54',NULL,NULL),('1112','天气炎热，注意防暑','<p>一、夏天不提倡进行爬山等在室外、白天进行的剧烈活动，建议可选择游泳、早晚慢跑等体育活动。 <br>二、要多喝白开水，并且要定时饮水，不要等口渴时再喝，口渴后不宜狂饮。应少喝果汁、汽水等饮料，其中含有较多的糖精和电解质，喝多了会对胃肠产生不良刺激，影响消化和食欲。 <br>三、不宜过量饮酒。人体在夏季受气温影响极易积蕴湿热，而湿热过盛又是诱发皮肤发生疮痈肿毒的病因，若大量饮白酒，更会助热生湿，无异于火上浇油。 <br>四、饮食不宜过于清淡。夏天人的活动时间长，出汗多，消耗大，应适当多吃鸡、鸭、瘦肉、鱼类、蛋类等营养食品，以满足人体代谢需要。夏天的时令蔬菜，如生菜、黄瓜、西红柿等的含水量较高；新鲜水果，如桃子、杏、西瓜、甜瓜等水分含量为80至90％，都可以用来补充水分。 <br>五、午睡时间不宜过长。午睡时间过长，中枢神经会加深抑制，脑内血流量相对减少会减慢代谢过程，导致醒来后周身不舒服而更加困倦。 <br>六、忌受热后“快速冷却”。炎夏，人们外出或劳动归来，喜欢不是开足电扇，就是立即去洗冷水澡，这样会使全身毛孔快速闭合，体内热量反而难以散发，还会因脑部血管迅速收缩而引起大脑供血不足，使人头晕目眩。 <br>七、空调室内外温差不宜太大。使用空调室内外温差不超过5度为宜，即使天气再热，空调室内温度也不宜到24度以下。 <br>八、不宜佩戴金属首饰。金属装饰品中的某些金属沾上汗水，所接触到的皮肤可能出现微红或瘙痒等症状，容易引发接触性皮炎。 <br>九、夏天出门记得要备好防晒用具，最好不要在上午10点至下午4点时在烈日下行走。如果此时必须外出，一定要做好防护工作，如打遮阳伞、戴遮阳帽、戴太阳镜，最好涂抹防晒霜。 <br>十、生活起居要规律，不经常熬夜，保证充分的睡眠也是预防中暑的有效措施。睡眠时注意不要躺在空调的出风口和电扇下。 <br>十一、出门还要随身携带防暑降温药品，如十滴水、仁丹、风油精等，以防应急之用。</p>','[{\"tag\":\"p\",\"attrs\":[],\"children\":[\"一、夏天不提倡进行爬山等在室外、白天进行的剧烈活动，建议可选择游泳、早晚慢跑等体育活动。 \",{\"tag\":\"br\",\"attrs\":[],\"children\":[]},\"二、要多喝白开水，并且要定时饮水，不要等口渴时再喝，口渴后不宜狂饮。应少喝果汁、汽水等饮料，其中含有较多的糖精和电解质，喝多了会对胃肠产生不良刺激，影响消化和食欲。 \",{\"tag\":\"br\",\"attrs\":[],\"children\":[]},\"三、不宜过量饮酒。人体在夏季受气温影响极易积蕴湿热，而湿热过盛又是诱发皮肤发生疮痈肿毒的病因，若大量饮白酒，更会助热生湿，无异于火上浇油。 \",{\"tag\":\"br\",\"attrs\":[],\"children\":[]},\"四、饮食不宜过于清淡。夏天人的活动时间长，出汗多，消耗大，应适当多吃鸡、鸭、瘦肉、鱼类、蛋类等营养食品，以满足人体代谢需要。夏天的时令蔬菜，如生菜、黄瓜、西红柿等的含水量较高；新鲜水果，如桃子、杏、西瓜、甜瓜等水分含量为80至90％，都可以用来补充水分。 \",{\"tag\":\"br\",\"attrs\":[],\"children\":[]},\"五、午睡时间不宜过长。午睡时间过长，中枢神经会加深抑制，脑内血流量相对减少会减慢代谢过程，导致醒来后周身不舒服而更加困倦。 \",{\"tag\":\"br\",\"attrs\":[],\"children\":[]},\"六、忌受热后“快速冷却”。炎夏，人们外出或劳动归来，喜欢不是开足电扇，就是立即去洗冷水澡，这样会使全身毛孔快速闭合，体内热量反而难以散发，还会因脑部血管迅速收缩而引起大脑供血不足，使人头晕目眩。 \",{\"tag\":\"br\",\"attrs\":[],\"children\":[]},\"七、空调室内外温差不宜太大。使用空调室内外温差不超过5度为宜，即使天气再热，空调室内温度也不宜到24度以下。 \",{\"tag\":\"br\",\"attrs\":[],\"children\":[]},\"八、不宜佩戴金属首饰。金属装饰品中的某些金属沾上汗水，所接触到的皮肤可能出现微红或瘙痒等症状，容易引发接触性皮炎。 \",{\"tag\":\"br\",\"attrs\":[],\"children\":[]},\"九、夏天出门记得要备好防晒用具，最好不要在上午10点至下午4点时在烈日下行走。如果此时必须外出，一定要做好防护工作，如打遮阳伞、戴遮阳帽、戴太阳镜，最好涂抹防晒霜。 \",{\"tag\":\"br\",\"attrs\":[],\"children\":[]},\"十、生活起居要规律，不经常熬夜，保证充分的睡眠也是预防中暑的有效措施。睡眠时注意不要躺在空调的出风口和电扇下。 \",{\"tag\":\"br\",\"attrs\":[],\"children\":[]},\"十一、出门还要随身携带防暑降温药品，如十滴水、仁丹、风油精等，以防应急之用。\"]}]','TZTG',NULL,'01','','1','紫萝园社区','2020-01-04 15:48:28','2020-01-14 12:40:37',NULL,NULL),('1113','2020年独生子女费将打卡发放','<p>根据新政策，户籍在本社区，子女未满18岁，已领取《独生子女父母光荣证》的并且个人存档或失业人员，之前在居委会登记过并领取了2019年下半年独生子女费的(5元/月/人)，请尽快到居委会提交领取人姓名开户的农商银行卡复印件，并需要提交相关材料：1、户口本 2、独生子女证 3、结婚证(离婚证)原件4、身份证5、现场填写《领取独生子女父母奖励费申请表》6、现场填写《个人承诺书》。谢谢配合!<br><br><br>办理期限：2019年12月10日------30日<br><br>地点：紫萝园社区服务站(石佛营东里136号院A座108室)<br><br>预约办理联系电话：85840762</p>','[{\"tag\":\"p\",\"attrs\":[],\"children\":[\"根据新政策，户籍在本社区，子女未满18岁，已领取《独生子女父母光荣证》的并且个人存档或失业人员，之前在居委会登记过并领取了2019年下半年独生子女费的(5元/月/人)，请尽快到居委会提交领取人姓名开户的农商银行卡复印件，并需要提交相关材料：1、户口本 2、独生子女证 3、结婚证(离婚证)原件4、身份证5、现场填写《领取独生子女父母奖励费申请表》6、现场填写《个人承诺书》。谢谢配合!\",{\"tag\":\"br\",\"attrs\":[],\"children\":[]},{\"tag\":\"br\",\"attrs\":[],\"children\":[]},{\"tag\":\"br\",\"attrs\":[],\"children\":[]},\"办理期限：2019年12月10日------30日\",{\"tag\":\"br\",\"attrs\":[],\"children\":[]},{\"tag\":\"br\",\"attrs\":[],\"children\":[]},\"地点：紫萝园社区服务站(石佛营东里136号院A座108室)\",{\"tag\":\"br\",\"attrs\":[],\"children\":[]},{\"tag\":\"