,'01','','1','紫萝园社区','2020-01-04 15:48:36','2020-01-14 13:48:00',NULL,NULL),('1115','社区介绍','<p>紫萝园社区简介<br>一、紫萝园社区成立于2006年5月，位于东风地区东部，东至京包铁路，西至石佛营路，南至石佛营东里小区中路，北至姚家园路。管辖面积0.22平方公里，现有21栋居民楼和1个平房院，管辖居民3443户。紫萝园社区居委会辖区既有奥士凯副食品公司、粮食局、饮食公司、服装公司、服务公司家属聚集的东商小区，有集体拆迁上楼的农转居人员的东里小区107号楼、109号楼、111号楼，还有教师楼小区，居住的都是东城的优秀教师，更有商住两用年轻人聚集的万科金阳小区，是高档小区与老旧小区相结合的多元化社区。社区共有20个居民小组，47个居民代表。社区党委下设4个党支部，317名党员。社区人口8641人，其中60岁以上老年人约2000余人，占到社区居民的25%，其中空巢、孤寡老人120余人，学龄前儿童约57人，青少年430人，残疾家庭约106户，失独家庭4户，流动人口约2532人。   二、社区工作者情况：目前社区共有社区工作者12人，其中党员11人。2010年设立了社区服务站，进一步明确了以社区党组织为核心、以社区自治组织为基础、以社区服务站为依托，形成了社区党组织、居委会和服务站“三驾马车”；既有明确分工又互相合作的新格局。社区“两委一站”班子健全，社区书记1人、主任1人，社区党委5人制，副书记2名，其中专职党务副书记1人；社区居委会7人制，设副主任1名。社区工作者全部为大专及以上学历，其中考取助理社工师4人。<br></p>','[{\"tag\":\"p\",\"attrs\":[],\"children\":[\"紫萝园社区简介\",{\"tag\":\"br\",\"attrs\":[],\"children\":[]},\"一、紫萝园社区成立于2006年5月，位于东风地区东部，东至京包铁路，西至石佛营路，南至石佛营东里小区中路，北至姚家园路。管辖面积0.22平方公里，现有21栋居民楼和1个平房院，管辖居民3443户。紫萝园社区居委会辖区既有奥士凯副食品公司、粮食局、饮食公司、服装公司、服务公司家属聚集的东商小区，有集体拆迁上楼的农转居人员的东里小区107号楼、109号楼、111号楼，还有教师楼小区，居住的都是东城的优秀教师，更有商住两用年轻人聚集的万科金阳小区，是高档小区与老旧小区相结合的多元化社区。社区共有20个居民小组，47个居民代表。社区党委下设4个党支部，317名党员。社区人口8641人，其中60岁以上老年人约2000余人，占到社区居民的25%，其中空巢、孤寡老人120余人，学龄前儿童约57人，青少年430人，残疾家庭约106户，失独家庭4户，流动人口约2532人。   二、社区工作者情况：目前社区共有社区工作者12人，其中党员11人。2010年设立了社区服务站，进一步明确了以社区党组织为核心、以社区自治组织为基础、以社区服务站为依托，形成了社区党组织、居委会和服务站“三驾马车”；既有明确分工又互相合作的新格局。社区“两委一站”班子健全，社区书记1人、主任1人，社区党委5人制，副书记2名，其中专职党务副书记1人；社区居委会7人制，设副主任1名。社区工作者全部为大专及以上学历，其中考取助理社工师4人。\",{\"tag\":\"br\",\"attrs\":[],\"children\":[]}]}]','SQJS',NULL,'01','','1','紫萝园社区','2020-01-04 15:48:42','2020-01-14 13:48:51',NULL,NULL),('1116','【宣传】2019年紫萝园社区视屏安全宣传','<p>为进一步普及食品安全知识，广泛动员全社会关心、支持和参与食品安全工作，切实做好食品安全宣传，2019年6月26日，紫萝园社区联合食药所在紫萝园105号院会议室开展食品安全宣传活动及保健食品“五进”科普宣传活动。到会人员40余人。通过宣传，进一步普及保健食品知识，促进居民科学认知保健食品，提升消费者理性消费意识及自我防护意识。此次保健食品进社区的科普宣传受到广大居民一致好评，深表受益匪浅。</p>','[{\"tag\":\"p\",\"attrs\":[],\"children\":[\"为进一步普及食品安全知识，广泛动员全社会关心、支持和参与食品安全工作，切实做好食品安全宣传，2019年6月26日，紫萝园社区联合食药所在紫萝园105号院会议室开展食品安全宣传活动及保健食品“五进”科普宣传活动。到会人员40余人。通过宣传，进一步普及保健食品知识，促进居民科学认知保健食品，提升消费者理性消费意识及自我防护意识。此次保健食品进社区的科普宣传受到广大居民一致好评，深表受益匪浅。\"]}]','SQFC',NULL,'01','','1','紫萝园社区','2020-01-04 15:48:44','2020-01-14 13:49:37',NULL,NULL),('1117','【活动】紫萝园社区党组织服务群众项目 -- 主题观影活动','<p>为了落实党组织服务群众宗旨，纪念新中国成立70周年及建党98周年华诞，强化基层党组织的服务功能，提高新形势下做好服务群众工作的能力，为了集聚党群共建的合力效应，紫萝园社区党委结合“动态楼宇”组织动员居民工作要点，2019年7月4日上午9:00在嘉华影院，组织党群80余人，以“不忘初心”为主题，开展了“赤紫之心”党建系列之主题观影教育活动，旨在弘扬基层党组织的战斗堡垒作用及共产党员的先锋模范作用，坚定党的领导形成合力，有效发挥群建资源，打造党群联动服务队伍。<br><br>此次观看的影片是最新上映的爱国主义题材电影《八子》，它是以中央苏区真实事件改编，讲述了革命先辈浴血奋战、舍生取义的战斗历史，所谓血肉铸山河，英雄永不朽，此次活动让党员群众们重新接受了一场“红色”的精神洗礼。</p>','[{\"tag\":\"p\",\"attrs\":[],\"children\":[\"为了落实党组织服务群众宗旨，纪念新中国成立70周年及建党98周年华诞，强化基层党组织的服务功能，提高新形势下做好服务群众工作的能力，为了集聚党群共建的合力效应，紫萝园社区党委结合“动态楼宇”组织动员居民工作要点，2019年7月4日上午9:00在嘉华影院，组织党群80余人，以“不忘初心”为主题，开展了“赤紫之心”党建系列之主题观影教育活动，旨在弘扬基层党组织的战斗堡垒作用及共产党员的先锋模范作用，坚定党的领导形成合力，有效发挥群建资源，打造党群联动服务队伍。\",{\"tag\":\"br\",\"attrs\":[],\"children\":[]},{\"tag\":\"br\",\"attrs\":[],\"children\":[]},\"此次观看的影片是最新上映的爱国主义题材电影《八子》，它是以中央苏区真实事件改编，讲述了革命先辈浴血奋战、舍生取义的战斗历史，所谓血肉铸山河，英雄永不朽，此次活动让党员群众们重新接受了一场“红色”的精神洗礼。\"]}]','SQFC',NULL,'01','','1','紫萝园社区','2019-11-12 15:48:49','2020-01-14 13:50:03',NULL,NULL),('1118','【三社一体化】健步走活动','<p>紫萝园社区2019三社一体化项目—— “快乐健步走•绿色健康行”活动，为热爱健康生活，倡导环境保护，拥抱大自然，紫萝园社区开展了“艺”境康健之“快乐健步走•绿色健康行”健步走活动。<br><br>此次活动以协商民主议事组织为主体，社区协助其开展，从而搭建辖区单位与居民的联系平台，居民与居民之间的互动，增加辖区单位与社区居民的幸福感和归属感，释放自己、关爱环保，享受健康生活。活动利用崇尚健康生活，接触大自然这一热门话题，吸引青年群体，倡导放下紧张的工作，脱离健身房高昂的费用，与大自然零接触，灌输既环保又健康的生活理念，从而带动其积极性，旨在动员中青年志愿者。<br><br>2019年7月31日上午8:00在朝阳公园东5门，紫萝园社区联合居民、青少年、党员、和谐促进员、辖区单位和居民议事厅成员志愿者共计60人参与了此次活动。<br><br>在社会组织及居委会的带领下，全体成员迎着朝阳，由朝阳公园东五门准时出发，向健步道行进，参加活动的居民中既有花甲老人，也有中青年人，还有小朋友，他们组成浩浩荡荡的健步行大军如一条长龙，招展着自己制作的队旗，绵延在道路周边，一路上欢声笑语，热闹非凡。为确保活动安全有序的开展，志愿者们分散在队伍中引导和服务，提示大家注意安全。<br><br>活动结束后，居民们纷纷表示此项活动的开展不仅锻炼了身体，还促进了居民间的交流，提高了大家自觉锻炼身体的意识，将吸引更多的人参与到全民健身运动中来。</p>','[{\"tag\":\"p\",\"attrs\":[],\"children\":[\"紫萝园社区2019三社一体化项目—— “快乐健步走•绿色健康行”活动，为热爱健康生活，倡导环境保护，拥抱大自然，紫萝园社区开展了“艺”境康健之“快乐健步走•绿色健康行”健步走活动。\",{\"tag\":\"br\",\"attrs\":[],\"children\":[]},{\"tag\":\"br\",\"attrs\":[],\"children\":[]},\"此次活动以协商民主议事组织为主体，社区协助其开展，从而搭建辖区单位与居民的联系平台，居民与居民之间的互动，增加辖区单位与社区居民的幸福感和归属感，释放自己、关爱环保，享受健康生活。活动利用崇尚健康生活，接触大自然这一热门话题，吸引青年群体，倡导放下紧张的工作，脱离健身房高昂的费用，与大自然零接触，灌输既环保又健康的生活理念，从而带动其积极性，旨在动员中青年志愿者。\",{\"tag\":\"br\",\"attrs\":[],\"children\":[]},{\"tag\":\"br\",\"attrs\":[],\"children\":[]},\"2019年7月31日上午8:00在朝阳公园东5门，紫萝园社区联合居民、青少年、党员、和谐促进员、辖区单位和居民议事厅成员志愿者共计60人参与了此次活动。\",{\"tag\":\"br\",\"attrs\":[],\"children\":[]},{\"tag\":\"br\",\"attrs\":[],\"children\":[]},\"在社会组织及居委会的带领下，全体成员迎着朝阳，由朝阳公园东五门准时出发，向健步道行进，参加活动的居民中既有花甲老人，也有中青年人，还有小朋友，他们组成浩浩荡荡的健步行大军如一条长龙，招展着自己制作的队旗，绵延在道路周边，一路上欢声笑语，热闹非凡。为确保活动安全有序的开展，志愿者们分散在队伍中引导和服务，提示大家注意安全。\",{\"tag\":\"br\",\"attrs\":[],\"children\":[]},{\"tag\":\"br\",\"attrs\":[],\"children\":[]},\"活动结束后，居民们纷纷表示此项活动的开展不仅锻炼了身体，还促进了居民间的交流，提高了大家自觉锻炼身体的意识，将吸引更多的人参与到全民健身运动中来。\"]}]','SQFC',NULL,'01','','1','紫萝园社区','2020-01-04 15:48:56','2020-01-14 14:10:09',NULL,NULL),('2111','办理80岁养老助残卡（即居家养老服务补贴）所需材料','<p>办理80岁养老助残卡（即居家养老服务补贴），周岁生日前提前一个月办理，需要提供以下材料： <br><br>1、老人身份证原件<br>2、老人户口本原件                                                                                                                                                                                              3、需要本人签字确认          </p>','[{\"tag\":\"p\",\"attrs\":[],\"children\":[\"办理80岁养老助残卡（即居家养老服务补贴），周岁生日前提前一个月办理，需要提供以下材料： \",{\"tag\":\"br\",\"attrs\":[],\"children\":[]},{\"tag\":\"br\",\"attrs\":[],\"children\":[]},\"1、老人身份证原件\",{\"tag\":\"br\",\"attrs\":[],\"children\":[]},\"2、老人户口本原件                                                                                                                                                                                              3、需要本人签字确认          \"]}]','LNR','/images/3.jpg','01','','1','紫萝园社区','2020-01-02 18:09:00','2020-01-14 13:55:10',NULL,NULL),('2112','本市、外埠60-64周岁老年人办理老年证所需材料','<p>本市、外埠 办理老年优待证（60—64周岁） （一）本市老年人业务办理，需要提供以下材料： <br>1.身份证正、反面复印件1份 <br>2. 白底彩色1寸照片1张 <br><br>（二）外埠老年人业务办理，需要提供以下材料： <br>1.暂住证（需在有效期内）第1、2页复印件1份（印在同一张A4纸上） <br>2. 白底彩色1寸照片1张 <br>注：年满周岁来京满4个月，周岁生日提前2个月申请<br><br>本市、外埠办理北京通—养老助残卡（65—79周岁10个月） <br>从2017年1月1日起都去北京农商银行办理。</p>','[{\"tag\":\"p\",\"attrs\":[],\"children\":[\"本市、外埠 办理老年优待证（60—64周岁） （一）本市老年人业务办理，需要提供以下材料： \",{\"tag\":\"br\",\"attrs\":[],\"children\":[]},\"1.身份证正、反面复印件1份 \",{\"tag\":\"br\",\"attrs\":[],\"children\":[]},\"2. 白底彩色1寸照片1张 \",{\"tag\":\"br\",\"attrs\":[],\"children\":[]},{\"tag\":\"br\",\"attrs\":[],\"children\":[]},\"（二）外埠老年人业务办理，需要提供以下材料： \",{\"tag\":\"br\",\"attrs\":[],\"children\":[]},\"1.暂住证（需在有效期内）第1、2页复印件1份（印在同一张A4纸上） \",{\"tag\":\"br\",\"attrs\":[],\"children\":[]},\"2. 白底彩色1寸照片1张 \",{\"tag\":\"br\",\"attrs\":[],\"children\":[]},\"注：年满周岁来京满4个月，周岁生日提前2个月申请\",{\"tag\":\"br\",\"attrs\":[],\"children\":[]},{\"tag\":\"br\",\"attrs\":[],\"children\":[]},\"本市、外埠办理北京通—养老助残卡（65—79周岁10个月） \",{\"tag\":\"br\",\"attrs\":[],\"children\":[]},\"从2017年1月1日起都去北京农商银行办理。\"]}]','LNR',NULL,'01','','1','紫萝园社区','2020-01-01 18:09:17','2020-01-14 13:55:34',NULL,NULL),('2113','办理第一个子女及第二个子女《生育服务证》所需材料','<p>一、办理第一个子女及第二个子女《生育服务证》所需材料<br><br>夫妻一方或双方为本市户籍的，可持一下相关内容到本市一方户籍地社区村（居）办理生育登记： <br>1、夫妻双方：户口本、身份证、结婚证原件。 <br>2、双方本人填写《生育登记信息采集表》和《生育服务证》第二页内容。如不能来本人来办理的，代办人还需提供《委托书》。 <br>3、子女已出生申请补办第一个子女《生育服务证》的，需提供包括子女《出生医学证明》原件 <br>4、办理第二个子女《生育服务证》除以上材料还需要提供，一孩的《独生子女证书》、《准生证》、《出生医学证明》。</p>','[{\"tag\":\"p\",\"attrs\":[],\"children\":[\"一、办理第一个子女及第二个子女《生育服务证》所需材料\",{\"tag\":\"br\",\"attrs\":[],\"children\":[]},{\"tag\":\"br\",\"attrs\":[],\"children\":[]},\"夫妻一方或双方为本市户籍的，可持一下相关内容到本市一方户籍地社区村（居）办理生育登记： \",{\"tag\":\"br\",\"attrs\":[],\"children\":[]},\"1、夫妻双方：户口本、身份证、结婚证原件。 \",{\"tag\":\"br\",\"attrs\":[],\"children\":[]},\"2、双方本人填写《生育登记信息采集表》和《生育服务证》第二页内容。如不能来本人来办理的，代办人还需提供《委托书》。 \",{\"tag\":\"br\",\"attrs\":[],\"children\":[]},\"3、子女已出生申请补办第一个子女《生育服务证》的，需提供包括子女《出生医学证明》原件 \",{\"tag\":\"br\",\"attrs\":[],\"children\":[]},\"4、办理第二个子女《生育服务证》除以上材料还需要提供，一孩的《独生子女证书》、《准生证》、《出生医学证明》。\"]}]','JS',NULL,'01','','1','紫萝园社区','2020-01-02 18:09:20','2020-01-14 13:56:00',NULL,NULL),('2114','办理外地来京人员生育服务联系单所需材料','<p>办理外地来京人员生育服务联系单所需材料 <br>1、男/女方户籍地计划生育部门出具的一年期内的：户籍所在地街乡镇计划生育部门出具婚育状况证明原件或原籍《准生证》一胎准生证须街/乡盖章；二胎准生证须区/县盖章的原件。 <br>2、享受生育保险人员的社保卡原件。 <br>3、享受生育保险人员单位开具的一年期内的婚育证明原件 <br>4、享受生育保险人员和其爱人的暂住证原件。 <br>5、孩子已出生的需要注明：孩子的“姓名、性别、出生日期”。</p>','[{\"tag\":\"p\",\"attrs\":[],\"children\":[\"办理外地来京人员生育服务联系单所需材料 \",{\"tag\":\"br\",\"attrs\":[],\"children\":[]},\"1、男/女方户籍地计划生育部门出具的一年期内的：户籍所在地街乡镇计划生育部门出具婚育状况证明原件或原籍《准生证》一胎准生证须街/乡盖章；二胎准生证须区/县盖章的原件。 \",{\"tag\":\"br\",\"attrs\":[],\"children\":[]},\"2、享受生育保险人员的社保卡原件。 \",{\"tag\":\"br\",\"attrs\":[],\"children\":[]},\"3、享受生育保险人员单位开具的一年期内的婚育证明原件 \",{\"tag\":\"br\",\"attrs\":[],\"children\":[]},\"4、享受生育保险人员和其爱人的暂住证原件。 \",{\"tag\":\"br\",\"attrs\":[],\"children\":[]},\"5、孩子已出生的需要注明：孩子的“姓名、性别、出生日期”。\"]}]','JZZ',NULL,'01','','1','紫萝园社区','2020-01-03 18:09:23','2020-01-14 13:56:27',NULL,NULL),('2115','申领第二代《中华人民共和国残疾人证》残疾证办理条件及所需材料','<p>申领第二代《中华人民共和国残疾人证》 <br>办理条件： <br>1、户口必须在本社区 <br>2、提交相关的近一年的病例、X光片 <br>3、本人或联系人自愿办证 <br>4、本人（精神、智力、行动特别困难患者除外）或联系人亲自到场申请<br><br>所需材料： 1、户口本首页、本人页、变更页复印件２份                                                                                                                                                                                                                         2、身份证复印件（正反面）３份 <br>3、二寸蓝底照片 3张 <br>4、三甲医院的诊断证明书原件及复印件１份（病例及影像资料）</p>','[{\"tag\":\"p\",\"attrs\":[],\"children\":[\"申领第二代《中华人民共和国残疾人证》 \",{\"tag\":\"br\",\"attrs\":[],\"children\":[]},\"办理条件： \",{\"tag\":\"br\",\"attrs\":[],\"children\":[]},\"1、户口必须在本社区 \",{\"tag\":\"br\",\"attrs\":[],\"children\":[]},\"2、提交相关的近一年的病例、X光片 \",{\"tag\":\"br\",\"attrs\":[],\"children\":[]},\"3、本人或联系人自愿办证 \",{\"tag\":\"br\",\"attrs\":[],\"children\":[]},\"4、本人（精神、智力、行动特别困难患者除外）或联系人亲自到场申请\",{\"tag\":\"br\",\"attrs\":[],\"children\":[]},{\"tag\":\"br\",\"attrs\":[],\"children\":[]},\"所需材料： 1、户口本首页、本人页、变更页复印件２份                                                                                                                                                                                                                         2、身份证复印件（正反面）３份 \",{\"tag\":\"br\",\"attrs\":[],\"children\":[]},\"3、二寸蓝底照片 3张 \",{\"tag\":\"br\",\"attrs\":[],\"children\":[]},\"4、三甲医院的诊断证明书原件及复印件１份（病例及影像资料）\"]}]','CJR',NULL,'01','','1','紫萝园社区','2020-01-10 18:09:26','2020-01-14 13:56:45',NULL,NULL),('2116','计划生育手册','由各种物质组成的巨型球状天体，叫做星球。星球有一定的形状，有自己的运行轨道。',NULL,'DZYL',NULL,'02','/images/1.jpg','1','紫萝园社区','2020-01-31 18:09:30',NULL,'计生知识','01'),('2117','垃圾分类手册','由各种物质组成的巨型球状天体，叫做星球。星球有一定的形状，有自己的运行轨道。',NULL,'DZYL',NULL,'02','/images/2.jpg','1','紫萝园社区','2020-01-09 18:09:32',NULL,'环保知识','01'),('2118','消防安全手册','由各种物质组成的巨型球状天体，叫做星球。星球有一定的形状，有自己的运行轨道。',NULL,'DZYL',NULL,'02','/images/3.jpg','1','紫萝园社区','2020-01-06 07:37:14',NULL,'消防知识','01'),('870026eb4f5b06101d22a1b5b6531222','啊水电费','',NULL,'DZYL','/images/pdf/4b6dab8ebcb546ce81b4ac9abfd99581.pdf','01',NULL,'1','紫萝园社区','2020-01-15 18:20:39','2020-01-15 18:48:11','环保知识','02');

/*Table structure for table `zly_benefit` */

DROP TABLE IF EXISTS `zly_benefit`;

CREATE TABLE `zly_benefit` (
  `bt_id` varchar(100) DEFAULT NULL COMMENT '公益id',
  `bt_user` varchar(100) DEFAULT NULL COMMENT '公益人id',
  `bt_name` varchar(100) DEFAULT NULL COMMENT '公益活动',
  `bt_time` datetime DEFAULT NULL COMMENT '公益时间',
  `bt_path` varchar(500) DEFAULT NULL COMMENT '公益证明图片',
  `bt_state` varchar(100) DEFAULT NULL COMMENT '审核状态  01:未审核 02:已通过  03:已驳回'
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `zly_benefit` */

/*Table structure for table `zly_event` */

DROP TABLE IF EXISTS `zly_event`;

CREATE TABLE `zly_event` (
  `event_id` varchar(100) NOT NULL COMMENT '活动id',
  `event_name` varchar(200) DEFAULT NULL COMMENT '活动名称',
  `event_type` varchar(10) DEFAULT NULL COMMENT '活动分类',
  `event_start` datetime DEFAULT NULL COMMENT '活动开始时间（如果没有结束时间，第二天默认结束）',
  `event_end` datetime DEFAULT NULL COMMENT '活动结束时间',
  `event_local` varchar(200) DEFAULT NULL COMMENT '举办地点',
  `event_limit` int(10) DEFAULT NULL COMMENT '名额',
  `event_real` int(10) DEFAULT '0' COMMENT '实际人数',
  `event_restart` datetime DEFAULT NULL COMMENT '报名开始时间',
  `event_reend` datetime DEFAULT NULL COMMENT '报名截止时间',
  `event_text` text COMMENT '活动介绍',
  `event_status` varchar(10) DEFAULT NULL COMMENT '活动状态  01：进行中 02：已结束',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_time` datetime DEFAULT NULL COMMENT '修改时间',
  `event_state` varchar(10) DEFAULT NULL COMMENT '用户-活动状态  01线上报名  02报名已截止  03活动已结束  04名额已满  05已报名',
  `event_code` int(10) DEFAULT NULL COMMENT '活动积分',
  PRIMARY KEY (`event_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

