/*Table structure for table `zly_event_user` */

DROP TABLE IF EXISTS `zly_event_user`;

CREATE TABLE `zly_event_user` (
  `id` varchar(100) NOT NULL,
  `event_id` varchar(100) DEFAULT NULL COMMENT '活动id',
  `user_id` varchar(100) DEFAULT NULL COMMENT '用户id',
  `sign` varchar(100) DEFAULT NULL COMMENT '是否签到  01：否  02：是',
  `sign_num` int(10) DEFAULT NULL COMMENT '签到次数(待定)',
  `time` datetime DEFAULT NULL COMMENT '报名时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

